CREATE DATABASE DOAN;
USE DOAN
drop DATABASE DOAN
CREATE TABLE REGIONS
(
    Regions_id char(3) PRIMARY KEY,
    Region_name VARCHAR(40),
    total_projects int,
);

CREATE TABLE COUNTRIES (
    [Country_name]    CHAR (48) NOT NULL,
    [Region_id]       CHAR (3)  CONSTRAINT [DEFAULT_COUNTRIES_Region_id] DEFAULT NULL NOT NULL,
    [total_projects ] INT       DEFAULT NULL ,
    PRIMARY KEY CLUSTERED ([Country_name] ASC),
    FOREIGN KEY ([Region_id]) REFERENCES [REGIONS] ([Regions_id])
);
CREATE TABLE PROJECTS
(
    Project_id char(7) PRIMARY KEY,
    Project_Name VARCHAR(100),
    Project_Status char(1) NOT NULL,
    Country char(48) FOREIGN KEY REFERENCES COUNTRIES(Country_name),
)
CREATE TABLE TIMELINE
(
    Project_id char(7) CONSTRAINT FK_TIMELINE_PROJECTID FOREIGN KEY REFERENCES PROJECTS(Project_id) UNIQUE ,
    Concept_Review smalldatetime,
    Appraisal smalldatetime,
    Approval smalldatetime,
    Effective_Actual smalldatetime,
    MidTerm_Review smalldatetime,
    Closing smalldatetime,
    Closing_Actual smalldatetime,
    Tot_Yrs float,
)

CREATE TABLE COST
(
    Project_id char(7)PRIMARY KEY FOREIGN KEY REFERENCES PROJECTS(Project_id),
    Estimated_Cost float,
    Actual_Cost float,
    Total_ICT_Component float,
    Total_WB_Disb float,
    BB float,
    Avg_BBbyyr float,
)

CREATE TABLE FMIS_SOLUTION
(
    Solution_id char(5) PRIMARY KEY,
    Project_id char(7) FOREIGN KEY REFERENCES PROJECTS(Project_id),
    FMIS_Abbreviation char(10),
    System_Name char(255),
    FMIS_Web_Link char(255),
    FMIS_ASW_Solution char(32),
    FMIS_Since int,
)

